import Register from "./components/Register/Register.js";
import Login from "./components/Login/Login.js";
import { Container, Col, Row } from "react-bootstrap";

export default function Account() {
	return (
		<Container>
			<Row>
				<Col xs={12} sm={12} md={6} lg={6}>
					<Register />
				</Col>
				<Col xs={12} sm={12} md={6} lg={6}>
					<Login />
				</Col>
			</Row>
		</Container>
	);
}
